import React from "react";
import { Link } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <Link path="/">about</Link>
      <Link path="/contact">contact</Link>
      <a href="/">about</a>;<a href="/contact">contact</a>;
    </>
  );
};
export default Menu;
